sys_variable_value.value:
(function execute(inputs, outputs) {
    var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gogle_vpn_spoke.fetch_networks', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var networks = [];
    obj.forEach(function(networkObj) {
        networks.push({
            "label": networkObj.name.toUpperCase(),
            "name": networkObj.name
        });
    })
    outputs.networks = {
        data: networks
    }
})(inputs, outputs);

